window.bookSummaryJSON = "<p><b>A legionnaire’s only failure is the failure to do what’s right.</b></p> <p>Kel Turner is a victim of his own success. His exploits and victories as part of Kill Team Three bring the attention of forces seeking hegemony over the Republic.</p> <p>These shadowy power brokers know that a man like Kel represents a threat to their plans...unless he can be persuaded to join them. And if the operator declines, his hidden enemy will stop at nothing to destroy him.</p> <p>At a deadly crossroads, Kel is told to choose between love and duty. But his foes are ignorant that he has a third choice.</p> <p><i>Win.</i></p> <p>The dark operator is the master of all the tools of lethal combat. Kel will need them all to succeed.&nbsp;</p> <p>Experience the epic fourth installment of the Dark Operator series and join Kel on a desperate, daring mission against an evil that runs deep in the heart of the Republic.</p>"; 
